{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/movie-recommendation-system-using-r-best?scriptVersionId=118930936\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"9ea468a6","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.011222,"end_time":"2023-02-12T10:05:43.773819","exception":false,"start_time":"2023-02-12T10:05:43.762597","status":"completed"},"tags":[]},"source":["# What is Movie Recommendation?\n","- A movie recommendation system, or a movie recommender system, is an ML-based approach to filtering or predicting the users’ film preferences based on their past choices and behavior. It’s an advanced filtration mechanism that predicts the possible movie choices of the concerned user and their preferences towards a domain-specific item, aka movie.\n","\n","# Filtration Strategies for Movie Recommendation Systems\n","- The most popular categories of the ML algorithms used for movie recommendations include content-based filtering and collaborative filtering systems.\n","    - Content-Based Filtering\n","    - Collaborative Filtering\n","        - Collaborative filtering algorithms are divided into two categories:\n","\n","            - User-based collaborative filtering. The idea is to look for similar patterns in movie preferences in the target user and other users in the database.\n","            - Item-based collaborative filtering. The basic concept here is to look for similar items (movies) that target users rate or interact with.\n","\n","\n","# How to Build a Movie Recommendation System?\n","- The basics of film recommendation engines are in machine learning, we could on to building an actual movie recommendation system.\n","    1. Data\n","        - ML systems need data, so find and import the essential libraries with movie datasets that already have global ratings.\n","    2. Analysis \n","        - Create generic recommendations of top-rated movies from the existing dataset.\n","    3. Personalization \n","        - Get personalized ratings by providing your own movie scores.\n","    4. Strategy \n","        - Implement a content-based or collaborative filtering strategy.\n","    5. Combination \n","        - Combine recommendation lists to get a reasonable estimate across the ratings. The combined dataset of movie ratings can now be used for either filtering model.\n","        \n","# Best Movie Datasets for Recommendation Systems in ML\n","- [MovieLens 25M data set](https://grouplens.org/datasets/movielens/)\n","- [IMDB Datasets](https://www.imdb.com/interfaces/)\n","- [Linguistic Data of 32k Film Subtitles with IMBDb Meta-Data](https://data.world/robertjoellewis/film-subtitles)\n","- [Film data set from UCI](https://archive.ics.uci.edu/ml/datasets/Movie)\n","- [Full MovieLens dataset on Kaggle](https://www.kaggle.com/rounakbanik/the-movies-dataset)\n","- [Cornell Film Review Data](http://www.cs.cornell.edu/people/pabo/movie-review-data/)\n","- [French National Cinema Center datasets](https://www.data.gouv.fr/fr/organizations/centre-national-du-cinema-et-de-l-image-animee/)\n","- [Movie Industry on Kaggle](https://www.kaggle.com/danielgrijalvas/movies)\n","- [Movie Body Counts](http://moviebodycounts.com/)\n","- [Movie datasets on data.world](https://data.world/datasets/movies)\n","\n","# Top Movie Recommendation System Use Cases\n","- [Netflix](https://www.netflix.com/)\n","- [Amazon](https://www.primevideo.com/)\n","- [YouTube](https://www.youtube.com/)\n","\n","##### Reference: [LabelYourData](https://labelyourdata.com/articles/movie-recommendation-with-machine-learning#introduction_to_the_movie_recommendation_system_architecture)\n","\n","# Important points of Movie Recommendation\n","\n","- Recommendation systems play an important role in e-commerce and online streaming services, such as Netflix, YouTube, and Amazon. Making the right recommendation for the next product, music or movie increases user retention and satisfaction, leading to sales and profit growth. Companies competing for customer loyalty invest in systems that capture and analyze the user’s preferences and offer products or services with a higher likelihood of purchase.\n","\n","- The economic impact of such a company-customer relationship is clear: Amazon is the largest online retail company by sales and part of its success comes from the recommendation system and marketing based on user preferences. In 2006 Netflix offered a one million dollar prize2 for the person or group that could improve their recommendation system by at least 10%.\n","\n","- Usually, recommendation systems are based on a rating scale from 1 to 5 grades or stars, with 1 indicating the lowest satisfaction and 5 being the highest satisfaction. Other indicators can also be used, such as comments posted on previously used items; video, music, or link shared with friends; percentage of movies watched or music listened; web pages visited and time spent on each page; product category; and any other interaction with the company’s web site or application can be used as a predictor.\n","\n","- The primary goal of recommendation systems is to help users find what they want based on their preferences and previous interactions and predict the rating for a new item. In this document, we create a movie recommendation system using the MovieLens dataset and apply the lessons learned during Harvard’s Data Science Professional Certificate3 program.\n","\n","- This document is structured as follows. Chapter 1 describes the dataset and summarizes the goal of the project and the key steps that were performed. In chapter 2 we explain the process and techniques used, such as data cleaning, data exploration, and visualization, any insights gained, and the modeling approach. In chapter 3 we present the modeling results and discuss the model performance. We conclude in chapter 4 with a brief summary of the report, its limitations, and future work.\n","\n","# MovieLens Dataset\n","- GroupLens is a research lab at the [University of Minnesota](https://twin-cities.umn.edu/) that has collected and made available rating data for movies on the [MovieLens website](https://grouplens.org/datasets/movielens/).\n","\n","- The complete MovieLens dataset consists of 27 million ratings of 58,000 movies by 280,000 users. The research presented in this paper is based on a subset of this dataset with 10 million ratings on 10,000 movies by 72,000 users.\n","\n","# Most common loss functions in ML\n","\n","- Mean Absolute Error/L1 Loss (MAE)\n","    - Mean absolute error, is measured as the average of the sum of absolute differences between predictions and actual observations. Like MSE, this as well measures the magnitude of error without considering their direction. Unlike MSE, MAE needs more complicated tools such as linear programming to compute the gradients. Plus MAE is more robust to outliers since it does not make use of squares.\n","    \n","    \n","- Mean Square Error/Quadratic Loss/L2 Loss (MSE)\n","    - Mean square error is measured as the average squared difference between predictions and actual observations. It’s only concerned with the average magnitude of error irrespective of their direction. However, due to squaring, predictions that are far away from actual values are penalized heavily in comparison to less deviated predictions. Plus MSE has nice mathematical properties which make it easier to calculate gradients.\n","    \n","    \n","- Root Mean Square Error (RMSE)\n","    - Root mean square error or root mean square deviation is one of the most commonly used measures for evaluating the quality of predictions. It shows how far predictions fall from measured true values using Euclidean distance.\n","    - To compute RMSE, calculate the residual (difference between prediction and truth) for each data point, compute the norm of residual for each data point, compute the mean of residuals, and take the square root of that mean. RMSE is commonly used in supervised learning applications, as RMSE uses and needs true measurements at each predicted data point."]},{"cell_type":"markdown","id":"11dfb6cf","metadata":{"papermill":{"duration":0.009208,"end_time":"2023-02-12T10:05:43.792797","exception":false,"start_time":"2023-02-12T10:05:43.783589","status":"completed"},"tags":[]},"source":["# Data Preparation"]},{"cell_type":"markdown","id":"960203cd","metadata":{"papermill":{"duration":0.00938,"end_time":"2023-02-12T10:05:43.811375","exception":false,"start_time":"2023-02-12T10:05:43.801995","status":"completed"},"tags":[]},"source":["## Install Libraries"]},{"cell_type":"code","execution_count":1,"id":"05a737e4","metadata":{"execution":{"iopub.execute_input":"2023-02-12T10:05:43.83508Z","iopub.status.busy":"2023-02-12T10:05:43.833002Z","iopub.status.idle":"2023-02-12T10:05:47.921039Z","shell.execute_reply":"2023-02-12T10:05:47.919065Z"},"papermill":{"duration":4.10384,"end_time":"2023-02-12T10:05:47.924361","exception":false,"start_time":"2023-02-12T10:05:43.820521","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: ggplot2\n","\n","Loading required package: lattice\n","\n","\n","Attaching package: ‘caret’\n","\n","\n","The following object is masked from ‘package:httr’:\n","\n","    progress\n","\n","\n","\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:data.table’:\n","\n","    between, first, last\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n","\n","Attaching package: ‘ggthemes’\n","\n","\n","The following object is ma